import React from 'react'
import styled from 'styled-components'
import Card from '../styles/styled.Card'

const Container = styled.div`
    display: flex;
    justify-content: center;
    flex-wrap: wrap;
`

const Blogs = () => {
  return (
    <Container>
      <Card />
    </Container>
  )
}

export default Blogs
